  false,\n\t\"url\": null,\n\t\"notes\": \"Four objectives have been established for
  the woodland management program for Sherburne NWR. These objectives are in compliance
  with and support the overall management objectives of the Refuge. The woodland management
  objectives are in descending order of priority: (1) to provide and enhance woodland
  habitat for waterfowl maintenance and production with emphasis on managing for species
  requiring special nesting habitat; (2) to restore and maintain native forest communities
  and wildlife; (3) to provide and maintain woodland habitat for wildlife diversity;
  including habitat for plant and wildlife species threatened or endangered through
  land management practices under other ownerships; and (4) to provide the public
  with woodland related opportunities for recreation; interpretation and environmental
  education when compatible with wildlife resource objectives.\",\n\t\"owner_org\":
